    public struct Complex2
    {
        public double real;
        public double imaginary;
        public Complex2(double real, double imaginary)
        {
            this.real = real;
            this.imaginary = imaginary;
        }
        public double magnitude
        {
            get
            {
                return Math.Sqrt(real * real + imaginary * imaginary);
            }
        }

        public double phase
        {
            get
            {
                return Math.Atan2(imaginary, real);
            }
        }

        public static Complex2 operator +(Complex2 c1, Complex2 c2)
        {
            return new Complex2(c1.real + c2.real, c1.imaginary + c2.imaginary);
        }

        public static Complex2 operator -(Complex2 c1, Complex2 c2)
        {
            return new Complex2(c1.real - c2.real, c1.imaginary - c2.imaginary);
        }

        public static Complex2 operator *(Complex2 c1, Complex2 c2)
        {
            return new Complex2(((c1.real) * (c2.real)) - ((c1.imaginary) * (c2.imaginary)), ((c1.real) * (c2.imaginary)) + ((c2.real) * (c1.imaginary)));
        }

        public static Complex2 operator /(Complex2 c1, Complex2 c2)
        {
            double a = (((c1.real) * (c2.real)) + ((c1.imaginary) * (c2.imaginary))) / (Math.Pow(c2.real, 2) + Math.Pow(c2.imaginary, 2));
            double b = (((c2.real) * (c1.imaginary)) - ((c1.real) * (c2.imaginary))) / (Math.Pow(c2.real, 2) + Math.Pow(c2.imaginary, 2));
            return new Complex2(a, b);
        }

    }


    class Program
